INSERT INTO `user_message` VALUES (1, 1414234, 1234567, '2021-01-07 17:26:17', '用户消息', '请问你什么时候有空？我想领取失物。', NULL);
INSERT INTO `user_message` VALUES (2, 1414234, 1234567, '2021-01-07 17:26:34', '用户消息', '拜托了，谢谢！', NULL);
INSERT INTO `user_message` VALUES (3, 1414234, 1234567, '2021-01-07 20:12:39', '用户消息', '你确定这是你丢失的东西吗，能说一些具体特征吗？', NULL);
INSERT INTO `user_message` VALUES (4, 1414234, 1234567, '2021-01-07 20:13:02', '用户消息', '是的，我的包底部有一条红色的划线，包里是我的一些证件和钱包。', NULL);
INSERT INTO `user_message` VALUES (5, 1414234, 123456, '2021-01-07 20:14:18', '用户消息', '你也可以看一下证件，我的名字是张梅梅。', NULL);
INSERT INTO `user_message` VALUES (6, 1414234, 1234567, '2021-01-07 20:16:17', '用户消息', '好的，我可以确认了。明天下午4点我会在留的地址处等你。', NULL);
INSERT INTO `user_message` VALUES (7, 1414234, 1234567, '2021-01-07 20:20:48', '用户消息', '十分感谢，明天我一定准时到。', NULL);
INSERT INTO `user_message` VALUES (8, 1414234, 1234567, '2021-01-07 20:21:22', '用户消息', '没事，明天见。', NULL);
INSERT INTO `user_message` VALUES (9, 1111111, 1943853, '2021-02-19 13:29:27', '系统消息', '您发布的任务被他人完成啦！快去确认吧。', NULL);
INSERT INTO `user_message` VALUES (10, 4364566, 6765766, '2021-02-19 13:31:40', '用户消息', '我看见你完成了我发布的任务。我想确认您找到的是不是我走失的狗狗。', NULL);
INSERT INTO `user_message` VALUES (11, 4364566, 6765766, '2021-02-19 13:32:50', '用户消息', '可以请你发一下照片吗？', NULL);
INSERT INTO `user_message` VALUES (12, 4364566, 6765766, '2021-02-19 13:43:49', '用户消息', '图片', NULL);
INSERT INTO `user_message` VALUES (13, 4364566, 6765766, '2021-02-19 13:44:23', '用户消息', '那我们约个时间见面吧，就今天下午6点可以吗？', NULL);
INSERT INTO `user_message` VALUES (14, 4364566, 6765766, '2021-02-19 13:45:18', '用户消息', '可以的，理解你着急的心情。我带着狗在莲花公园门口等你。', NULL);
INSERT INTO `user_message` VALUES (15, 4364566, 6765766, '2021-02-19 13:47:28', '用户消息', '谢谢，非常感谢，幸好及时找到了他，谢谢你的帮助。', NULL);
INSERT INTO `user_message` VALUES (16, 4364566, 6765766, '2021-02-19 13:50:04', '用户消息', '不客气啊，大家互相帮助！', NULL);
INSERT INTO `user_message` VALUES (17, 1111111, 7657878, '2021-02-19 18:50:40', '系统消息', '您接受的任务被他人完成。', NULL);
INSERT INTO `user_message` VALUES (18, 1111111, 7657878, '2021-02-20 13:51:48', '系统消息', '您接受的任务被删除。', NULL);

